import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from 'react-router-dom';

const HousingEdit = () => {
  const navigate = useNavigate();
  const House_API = "http://26.90.237.200:3000/admin/house_type/edit";

  const [formData, setFormData] = useState({
    id: "",
    addHousePlan: "",
    addNumDeed: "",
    addLandArea: "",
    addPrice: "",
    addNote: "",
    addStatus: "",
    addImage: "",
    addidFK: ""
  });

  const { id, addHousePlan, addNumDeed, addLandArea, addPrice, addNote, addStatus, addImage, addidFK } = formData;

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const updateEmp = async () => {
    try {
      const response = await axios.patch(House_API, formData);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
    navigate('/Housing');
  };

  return (
    <div className="container">
      <form>
        <div className="mb-3">
          <div>
            <label htmlFor="id" className="form-label">รหัส</label>
            <input
              type="text"
              className="form-control"
              id="id"
              name="id"
              value={id}
              onChange={handleChange}
            />
          </div>
          <div>
            <label htmlFor="addHousePlan" className="form-label">ชื่อใหม่</label>
            <input
              type="text"
              className="form-control"
              id="addHousePlan"
              name="addHousePlan"
              value={addHousePlan}
              onChange={handleChange}
            />
          </div>
          <div>
            <label htmlFor="addNumDeed" className="form-label">พื้นที่ใช้สอยใหม่</label>
            <input
              type="text"
              className="form-control"
              id="addNumDeed"
              name="addNumDeed"
              value={addNumDeed}
              onChange={handleChange}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">ราคาเริ่มต้นใหม่</label>
            <input
              type="text"
              className="form-control"
              id="addLandArea"
              name="addLandArea"
              value={addLandArea}
              onChange={handleChange}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">ราคาเริ่มต้นใหม่</label>
            <input
              type="text"
              className="form-control"
              id="addLandArea"
              name="addLandArea"
              value={addPrice}
              onChange={handleChange}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">ราคาเริ่มต้นใหม่</label>
            <input
              type="text"
              className="form-control"
              id="addLandArea"
              name="addLandArea"
              value={addNote}
              onChange={handleChange}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">ราคาเริ่มต้นใหม่</label>
            <input
              type="text"
              className="form-control"
              id="addLandArea"
              name="addLandArea"
              value={addStatus}
              onChange={handleChange}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">ราคาเริ่มต้นใหม่</label>
            <input
              type="text"
              className="form-control"
              id="addLandArea"
              name="addLandArea"
              value={addImage}
              onChange={handleChange}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">ราคาเริ่มต้นใหม่</label>
            <input
              type="text"
              className="form-control"
              id="addLandArea"
              name="addLandArea"
              value={addidFK}
              onChange={handleChange}
            />
          </div>
        </div>

        <button type="button" className="btn btn-primary" onClick={updateEmp}>
          แก้ไขข้อมูล
        </button>
      </form>
    </div>
  );
};

export default HousingEdit;
